import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Main from './Main';
import Ds from './routes/Ds'

const Home = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Main />}></Route>
        <Route path="./routes/ds" element={<Ds />}></Route>
      </Routes>
    </Router>
  )
}

export default Home
